import React from 'react';
import logo from './logo.svg';
import './App.css';
import { Navbar } from 'react-bootstrap';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1 class="text-color center-text"> Portfolio de Samuel </h1>
        <p class="center-text-description">
        Hello ! Je m'appelle Samuel. Je suis un étudiant à Epitech.
        </p>
        <Navbar />
      </header>
    </div>
  );
}

export default App;
